import React, { useEffect, useState } from 'react';
import './Menu.css';

const Menu = () => {
    const [menuItems, setMenuItems] = useState([]);

    useEffect(() => {
        fetch('/data/menu.json')
            .then(response => response.json())
            .then(data => setMenuItems(data));
    }, []);

    return (
        <nav className="menu">
            <ul>
                {menuItems.map(item => (
                    <li key={item.id}>{item.name}</li>
                ))}
            </ul>
        </nav>
    );
};

export default Menu;
